class BaseSampleAsset(ABC):
    """Base class for sample asset processor."""

    _name: str = "Sample"
    """Name of the sample asset processor."""

    def __init__(self, name: str) -> None:
        """
        Construct the sample asset processor.

        Parameters:
            name (str): Name of the sample asset processor.

        """
        self._name = name
        log.debug(msg=f'Creating sample asset for "{self._name}".')

    def _fetch(self) -> bool:
        """
        Fetch the sample asset from a remote source.

        Parameters:
            None

        Returns:
            bool: `True` if the sample asset was fetched successfully, `False` otherwise.

        """
        return True

    def _process_download(self) -> bool:
        """
        Process the downloaded sample asset.

        Parameters:
            None

        Returns:
            bool: `True` if the sample asset was processed successfully, `False` otherwise.

        """
        return True

    def _convert(self) -> bool:
        """
        Convert the sample asset to a glTF file.

        Parameters:
            None

        Returns:
            bool: `True` if the sample asset was converted successfully, `False` otherwise.

        """
        return True

    def process(self) -> bool:
        """
        Process the sample asset.

        Parameters:
            None

        Returns:
            bool: `True` if the sample asset was processed successfully, `False` otherwise.

        """
        tasks: List[Tuple[Callable, str]] = [
            (self._fetch, "fetching"),
            (self._process_download, "processing downloaded content"),
            (self._convert, "converting downloaded content"),
        ]
        for task_callback, task_description in tasks:
            log.debug(msg=f'Asset for "{self._name}": {task_description.capitalize()}.')
            success = task_callback()
            if not success:
                log.warn(msg=f'Asset for "{self._name}": Failed {task_description}.')
                return False
        
        log.debug(msg=f'Done processing asset for "{self._name}".')
        return True


