def prepare_sample_assets() -> None:
    """Create sample USD assets."""
    log.debug(msg="Creating sample USD assets.")

    # Create output directory where glTF asets will be placed:
    os.makedirs(name=get_content_output_directory(), exist_ok=True)

    # Create collection of glTF sample assets:
    asset_processors = [
        # PixarKitchenSetSampleAsset(),
        PixarToasterSampleAsset(),
        ASWFTeapotSampleAsset(),
    ]
    def worker(asset_processor: BaseSampleAsset) -> None:
        asset_processor.process()

    # Launch sample asset processors in parallel, each in their own Thread:
    with ThreadPoolExecutor() as executor:
        executor.map(worker, asset_processors)
